{"query":"
    mutation register($input: RegistrationInput!) {
        register(registration: $input) {
            account {
                ...account
                attributes {
                    email
                }
                id
                activeProfile {
                    ...profile
                }
                profiles {
                    ...profile
                }
            }
            activeSession {
                ...session
            }
            identity {
                ...identity
            }
            actionGrant
        }
    }


fragment identity on Identity {
    attributes {
        securityFlagged
        createdAt
        passwordResetRequired
    }
    flows {
        marketingPreferences {
            eligibleForOnboarding
            isOnboarded
        }
        personalInfo {
            eligibleForCollection
            requiresCollection
        }
    }
    personalInfo {
        dateOfBirth
        gender
    }
    subscriber {
        subscriberStatus
        subscriptionAtRisk
        overlappingSubscription
        doubleBilled
        doubleBilledProviders
        subscriptions {
            id
            groupId
            state
            partner
            isEntitled
            source {
                sourceType
                sourceProvider
                sourceRef
                subType
            }
            paymentProvider
            product {
                id
                sku
                offerId
                promotionId
                name
                nextPhase {
                    sku
                    offerId
                    campaignCode
                    voucherCode
                }
                entitlements {
                    id
                    name
                    desc
                    partner
                }
                categoryCodes
                redeemed {
                    campaignCode
                    redemptionCode
                    voucherCode
                }
                bundle
                bundleType
                subscriptionPeriod
                earlyAccess
                trial {
                    duration
                }
            }
            term {
                purchaseDate
                startDate
                expiryDate
                nextRenewalDate
                pausedDate
                churnedDate
                isFreeTrial
            }
            externalSubscriptionId,
            cancellation {
                type
                restartEligible
            }
            stacking {
                status
                overlappingSubscriptionProviders
                previouslyStacked
                previouslyStackedByProvider
            }
        }
    }
}


fragment account on Account {
    id
    attributes {
        blocks {
            expiry
            reason
        }
        consentPreferences {
            dataElements {
                name
                value
            }
            purposes {
                consentDate
                firstTransactionDate
                id
                lastTransactionCollectionPointId
                lastTransactionCollectionPointVersion
                lastTransactionDate
                name
                status
                totalTransactionCount
                version
            }
        }
        dssIdentityCreatedAt
        email
        emailVerified
        lastSecurityFlaggedAt
        locations {
            manual {
                country
            }
            purchase {
                country
                source
            }
            registration {
                geoIp {
                    country
                }
            }
        }
        securityFlagged
        tags
        taxId
        userVerified
    }
    parentalControls {
        isProfileCreationProtected
    }
    flows {
        star {
            isOnboarded
        }
    }
}


fragment profile on Profile {
    id
    name
    isAge21Verified
    attributes {
        avatar {
            id
            userSelected
        }
        isDefault
        kidsModeEnabled
        languagePreferences {
            appLanguage
            playbackLanguage
            preferAudioDescription
            preferSDH
            subtitleAppearance {
                backgroundColor
                backgroundOpacity
                description
                font
                size
                textColor
            }
            subtitleLanguage
            subtitlesEnabled
        }
        groupWatch {
            enabled
        }
        parentalControls {
            kidProofExitEnabled
            isPinProtected
        }
        playbackSettings {
            autoplay
            backgroundVideo
            prefer133
            preferImaxEnhancedVersion
            previewAudioOnHome
            previewVideoOnHome
        }
    }
    personalInfo {
        dateOfBirth
        gender
        age
    }
    maturityRating {
        ...maturityRating
    }
    personalInfo {
        dateOfBirth
        age
        gender
    }
    flows {
        personalInfo {
            eligibleForCollection
            requiresCollection
        }
        star {
            eligibleForOnboarding
            isOnboarded
        }
    }
}


fragment maturityRating on MaturityRating {
    ratingSystem
    ratingSystemValues
    contentMaturityRating
    maxRatingSystemValue
    isMaxContentMaturityRating
}



fragment session on Session {
    device {
        id
        platform
    }
    entitlements
    features {
        coPlay
    }
    inSupportedLocation
    isSubscriber
    location {
        type
        countryCode
        dma
        asn
        regionName
        connectionType
        zipCode
    }
    sessionId
    experiments {
        featureId
        variantId
        version
    }
    identity {
        id
    }
    account {
        id
    }
    profile {
        id
        parentalControls {
            liveAndUnratedContent {
                enabled
            }
        }
    }
    partnerName
    preferredMaturityRating {
        impliedMaturityRating
        ratingSystem
    }
    homeLocation {
        countryCode
    }
    portabilityLocation {
        countryCode
        type
    }
}

